A trait declaration T with a proxy attribute will have a derived TProxy and TProxyBlocking (see chapter on "blocking" for more information on that) implemented thanks to procedural macros. The trait methods will have respective impl methods wrapping the D-Bus calls: use std::collections::HashMap;
use std::error::Error; use zbus::{zvariant::Value, proxy, Connection}; #[proxy( default_service = "org.freedesktop.Notifications", default_path = "/org/freedesktop/Notifications"
)]
trait Notifications { /// Call the org.freedesktop.Notifications.Notify D-Bus method fn notify(&self, app_name: &str, replaces_id: u32, app_icon: &str, summary: &str, body: &str, actions: &[&str], hints: HashMap<&str, &Value<'_>>, expire_timeout: i32) -> zbus::Result<u32>;
} // Although we use `async-std` here, you can use any async runtime of choice.
#[async_std::main]
async fn main() -> Result<(), Box<dyn Error>> { let connection = Connection::session().await?; let proxy = NotificationsProxy::new(&connection).await?; let reply = proxy.notify( "my-app", 0, "dialog-information", "A summary", "Some body", &[], HashMap::new(), 5000, ).await?; dbg!(reply); Ok(())
} A TProxy and TProxyBlocking has a few associated methods, such as new(connection), using the default associated service name and object path, and an associated builder if you need to specify something different. This should help to avoid the kind of mistakes we saw earlier. It's also a bit easier to use, thanks to Rust type inference. This makes it also possible to have higher-level types, they fit more naturally with the rest of the code. You can further document the D-Bus API or provide additional helpers. Note For simple transient cases like the one above, you may find the blocking API very convenient to use.

