Signals are like methods, except they don't expect a reply. They are typically emitted by services to notify interested peers of any changes to the state of the service. zbus provides you a Stream -based API for receiving signals. Let's look at this API in action, with an example where we monitor started systemd units. # // NOTE: When changing this, please also keep `zbus/examples/watch-systemd-jobs.rs` in sync.
use async_std::stream::StreamExt;
use zbus::Connection;
use zbus_macros::proxy;
use zvariant::OwnedObjectPath; # fn main() {
# async_io::block_on(watch_systemd_jobs()).expect("Error listening to signal");
# } #[proxy( default_service = "org.freedesktop.systemd1", default_path = "/org/freedesktop/systemd1", interface = "org.freedesktop.systemd1.Manager"
)]
trait Systemd1Manager { // Defines signature for D-Bus signal named `JobNew` #[zbus(signal)] fn job_new(&self, id: u32, job: OwnedObjectPath, unit: String) -> zbus::Result<()>;
} async fn watch_systemd_jobs() -> zbus::Result<()> { let connection = Connection::system().await?; // `Systemd1ManagerProxy` is generated from `Systemd1Manager` trait let systemd_proxy = Systemd1ManagerProxy::new(&connection).await?; // Method `receive_job_new` is generated from `job_new` signal let mut new_jobs_stream = systemd_proxy.receive_job_new().await?; while let Some(msg) = new_jobs_stream.next().await { // struct `JobNewArgs` is generated from `job_new` signal function arguments let args: JobNewArgs = msg.args().expect("Error parsing message"); println!( "JobNew received: unit={} id={} path={}", args.unit, args.id, args.job ); } panic!("Stream ended unexpectedly");
} More advanced example Here is a more elaborate example, where we get our location from Geoclue : use zbus::{zvariant::ObjectPath, proxy, Connection, Result};
use futures_util::stream::StreamExt; #[proxy( default_service = "org.freedesktop.GeoClue2", interface = "org.freedesktop.GeoClue2.Manager", default_path = "/org/freedesktop/GeoClue2/Manager"
)]
trait Manager { #[zbus(object = "Client")] fn get_client(&self);
} #[proxy( default_service = "org.freedesktop.GeoClue2", interface = "org.freedesktop.GeoClue2.Client"
)]
trait Client { fn start(&self) -> Result<()>; fn stop(&self) -> Result<()>; #[zbus(property)] fn set_desktop_id(&mut self, id: &str) -> Result<()>; #[zbus(signal)] fn location_updated(&self, old: ObjectPath<'_>, new: ObjectPath<'_>) -> Result<()>;
} #[proxy( default_service = "org.freedesktop.GeoClue2", interface = "org.freedesktop.GeoClue2.Location"
)]
trait Location { #[zbus(property)] fn latitude(&self) -> Result<f64>; #[zbus(property)] fn longitude(&self) -> Result<f64>;
} // Although we use `async-std` here, you can use any async runtime of choice.
#[async_std::main]
async fn main() -> Result<()> { let conn = Connection::system().await?; let manager = ManagerProxy::new(&conn).await?; let mut client = manager.get_client().await?; // Gotta do this, sorry! client.set_desktop_id("org.freedesktop.zbus").await?; let props = zbus::fdo::PropertiesProxy::builder(&conn) .destination("org.freedesktop.GeoClue2")? .path(client.inner().path())? .build() .await?; let mut props_changed = props.receive_properties_changed().await?; let mut location_updated = client.receive_location_updated().await?; client.start().await?; futures_util::try_join!( async { while let Some(signal) = props_changed.next().await { let args = signal.args()?; for (name, value) in args.changed_properties().iter() { println!("{}.{} changed to `{:?}`", args.interface_name(), name, value); } } Ok::<(), zbus::Error>(()) }, async { while let Some(signal) = location_updated.next().await { let args = signal.args()?; let location = LocationProxy::builder(&conn) .path(args.new())? .build() .await?; println!( "Latitude: {}\nLongitude: {}", location.latitude().await?, location.longitude().await?, ); } // No need to specify type of Result each time Ok(()) } )?; Ok(())
} While the Geoclue's D-Bus API is a bit involved, we still ended-up with a not-so-complicated (~100 LOC) code for getting our location.

