Interfaces can have associated properties, which can be read or set with the org.freedesktop.DBus.Properties interface. Here again, the #[proxy] attribute comes to the rescue to help you. You can annotate a trait method to be a getter: # use zbus::{proxy, Result};
#
#[proxy]
trait MyInterface { #[zbus(property)] fn state(&self) -> Result<String>;
} The state() method will translate to a "State" property Get call. To set the property, prefix the name of the property with set_. For a more real world example, let's try and read two properties from systemd's main service: # use zbus::{Connection, proxy, Result};
#
#[proxy( interface = "org.freedesktop.systemd1.Manager", default_service = "org.freedesktop.systemd1", default_path = "/org/freedesktop/systemd1"
)]
trait SystemdManager { #[zbus(property)] fn architecture(&self) -> Result<String>; #[zbus(property)] fn environment(&self) -> Result<Vec<String>>;
} #[async_std::main]
async fn main() -> Result<()> { let connection = Connection::system().await?; let proxy = SystemdManagerProxy::new(&connection).await?; println!("Host architecture: {}", proxy.architecture().await?); println!("Environment:"); for env in proxy.environment().await? { println!(" {}", env); } Ok(())
} You should get an output similar to this: Host architecture: x86-64
Environment variables: HOME=/home/zeenix LANG=en_US.UTF-8 LC_ADDRESS=de_DE.UTF-8 LC_IDENTIFICATION=de_DE.UTF-8 LC_MEASUREMENT=de_DE.UTF-8 LC_MONETARY=de_DE.UTF-8 LC_NAME=de_DE.UTF-8 LC_NUMERIC=de_DE.UTF-8 LC_PAPER=de_DE.UTF-8 LC_TELEPHONE=de_DE.UTF-8 LC_TIME=de_DE.UTF-8 ... Trait-bounds for property values If you use custom types for property values, you might get a compile error for missing TryFrom<zvariant::Value<'_>> and/or TryFrom<OwnedValue> implementations. This is because properties are always sent as Variants on the bus, so you need to implement these conversions for your custom types. Not to worry though, the zvariant crate provides a Value and OwnedValue derive macro to implement these conversions for you. Watching for changes By default, the proxy will cache the properties and watch for changes. To be notified of a property change, you use a stream API, just like for receiving signals. The methods are named after the properties' names: receive_<prop_name>_changed(). Here is an example: # use zbus::{Connection, proxy, Result};
# use futures_util::stream::StreamExt;
#
# #[async_std::main]
# async fn main() -> Result<()> { #[proxy( interface = "org.freedesktop.systemd1.Manager", default_service = "org.freedesktop.systemd1", default_path = "/org/freedesktop/systemd1" )] trait SystemdManager { #[zbus(property)] fn log_level(&self) -> Result<String>; } let connection = Connection::system().await?; let proxy = SystemdManagerProxy::new(&connection).await?; let mut stream = proxy.receive_log_level_changed().await; while let Some(v) = stream.next().await { println!("LogLevel changed: {:?}", v.get().await); }
#
# Ok(())
# }

