The zbus_xmlgen crate provides a developer-friendly tool , that can generate Rust traits from a given D-Bus introspection XML for you. Note: This tool should not be considered a drop-in Rust-specific replacement for similar tools available for low-level languages, such as gdbus-codegen . Unlike those tools, this is only meant as a starting point to generate the code, once. In many cases, you will want to tweak the generated code. The tool can be used to generate rust code directly from a D-Bus service running on our system: zbus-xmlgen session \ org.freedesktop.Notifications \ /org/freedesktop/Notifications Alternatively you can also get the XML interface from a different source and use it to generate the interface code. Some packages may also provide the XML directly as an installed file, allowing it to be queried using pkg-config , for example. We can fetch the XML interface of the notification service, using the --xml-interface option of the busctl [1] command. This option was introduced to busctl in systemd v243. busctl --user --xml-interface introspect \ org.freedesktop.Notifications \ /org/freedesktop/Notifications You should get a similar output: <!DOCTYPE node PUBLIC "-//freedesktop//DTD D-BUS Object Introspection 1.0//EN" "http://www.freedesktop.org/standards/dbus/1.0/introspect.dtd">
