#[proxy( interface = "org.freedesktop.Notifications", default_service = "org.freedesktop.Notifications", default_path= "/org/freedesktop/Notifications",
)]
trait Notifications { /// CloseNotification method fn close_notification(&self, arg_0: u32) -> zbus::Result<()>; /// GetCapabilities method fn get_capabilities(&self) -> zbus::Result<Vec<String>>; /// GetServerInformation method fn get_server_information(&self) -> zbus::Result<(String, String, String, String)>; /// Notify method fn notify( &self, arg_0: &str, arg_1: u32, arg_2: &str, arg_3: &str, arg_4: &str, arg_5: &[&str], arg_6: std::collections::HashMap<&str, zvariant::Value<'_>>, arg_7: i32, ) -> zbus::Result<u32>; /// ActionInvoked signal #[zbus(signal)] fn action_invoked(&self, arg_0: u32, arg_1: &str) -> zbus::Result<()>; /// NotificationClosed signal #[zbus(signal)] fn notification_closed(&self, arg_0: u32, arg_1: u32) -> zbus::Result<()>;
} It should be usable as such. But you may as well improve a bit the naming of the arguments, use better types (using BitFlags, structs or other custom types), add extra documentation, and other functions to make the binding more pleasing to use from Rust. For example, the generated GetServerInformation method can be improved to a nicer version: # use serde::{Serialize, Deserialize};
# use zbus::{zvariant::Type, proxy};
#
#[derive(Debug, Type, Serialize, Deserialize)]
pub struct ServerInformation { /// The product name of the server. pub name: String, /// The vendor name. For example "KDE," "GNOME," "freedesktop.org" or "Microsoft". pub vendor: String, /// The server's version number. pub version: String, /// The specification version the server is compliant with. pub spec_version: String,
