Since the use of a dictionary, specifically one with strings as keys and variants as value (i-e a{sv}) is very common in the D-Bus world and use of HashMaps isn't as convenient and type-safe as a struct, you might find yourself wanting to use a struct as a dictionary. zvariant provides convenient macros for making this possible: SerializeDict and DeserializeDict . You'll also need to tell Type macro to treat the type as a dictionary using the signature attribute. Here is a simple example: use zbus::{ proxy, interface, fdo::Result, zvariant::{DeserializeDict, SerializeDict, Type},
}; #[derive(DeserializeDict, SerializeDict, Type)]
// `Type` treats `dict` is an alias for `a{sv}`.
#[zvariant(signature = "dict")]
pub struct Dictionary { field1: u16, #[zvariant(rename = "another-name")] field2: i64, optional_field: Option<String>,
} #[proxy( interface = "org.zbus.DictionaryGiver", default_path = "/org/zbus/DictionaryGiver", default_service = "org.zbus.DictionaryGiver",
)]
trait DictionaryGiver { fn give_me(&self) -> Result<Dictionary>;
} struct DictionaryGiverInterface; #[interface(interface = "org.zbus.DictionaryGiver")]
impl DictionaryGiverInterface { fn give_me(&self) -> Result<Dictionary> { Ok(Dictionary { field1: 1, field2: 4, optional_field: Some(String::from("blah")), }) }
}
